import React from "react";
import { Component } from 'react';
import { plusHeart } from "./Manage";
import {heart} from "./Manage";


class Detail extends Component {

    render() {
        return (
            <div>
                <h3>관리 임시 페이지입니다.</h3>
                <img src={this.props.images[this.props.id]} alt='token'></img>
                <div>{this.props.names[this.props.id]}</div>
                <div>{this.props.descriptions[this.props.id]}</div>
                <div>{this.props.price}</div>
                <div>{heart[this.props.id]}</div>
                <input type='button' value="좋아요" onClick={()=>{plusHeart(0)}}></input>
            </div>
        );
    }
}

export default Detail;

